INSERT INTO `makanan` (`id_makanan`, `nama_makanan`, `deskripsi`, `harga`, `gambar`) VALUES
(2, 'Ayam Goreng', 'Ayam goreng adalah hidangan klasik yang terdiri dari potongan ayam yang dibumbui dan digoreng hingga kecokelatan di luar, namun tetap lembut di dalamnya. Dibumbui dengan rempah-rempah seperti garam, lada, dan bawang putih, ayam tersebut dicelupkan ke dalam tepung atau remah roti sebelum digoreng hingga matang. Hidangan ini memiliki cita rasa gurih dan aroma yang menggugah selera, sering disajikan dengan pelengkap seperti nasi putih, kentang goreng, atau saus sambal. Ayam goreng adalah favorit banyak orang di seluruh dunia.', 17000, );
INSERT INTO `makanan` (`id_makanan`, `nama_makanan`, `deskripsi`, `harga`, `gambar`) VALUES
(3, 'Nasi Putih', 'Nasi putih adalah hidangan pokok yang terbuat dari butiran beras yang dimasak hingga menjadi lembut dan berserat. Dengan tekstur yang lembut dan rasa yang netral, nasi putih sering dijadikan sebagai pendamping hidangan utama dalam berbagai masakan. Kehadirannya melengkapi hidangan dengan sederhana namun memuaskan.', 5000, );
INSERT INTO `makanan` (`id_makanan`, `nama_makanan`, `deskripsi`, `harga`, `gambar`) VALUES
(5, 'Ayam Bakar', 'Ayam bakar adalah hidangan yang terdiri dari potongan ayam yang dibumbui dengan rempah-rempah khas, kemudian dipanggang hingga matang dan berwarna kecokelatan. Dengan cita rasa yang gurih dan aroma harum yang menggugah selera, ayam bakar sering dihidangkan dengan nasi putih dan pelengkap lainnya. Hidangan ini merupakan pilihan populer di berbagai restoran dan warung makan.', 17000, );
INSERT INTO `makanan` (`id_makanan`, `nama_makanan`, `deskripsi`, `harga`, `gambar`) VALUES
(6, 'Ayam Panggang', 'Ayam panggang adalah hidangan yang terdiri dari potongan ayam yang dipanggang di atas bara api atau dalam oven hingga matang dengan sempurna. Dibumbui dengan rempah-rempah dan saus yang khas, ayam panggang memiliki cita rasa yang kaya dan aroma yang menggoda selera. Hidangan ini sering disajikan dengan pelengkap seperti kentang panggang, sayuran, atau saus tambahan untuk meningkatkan kenikmatannya.', 17000, );
INSERT INTO `makanan` (`id_makanan`, `nama_makanan`, `deskripsi`, `harga`, `gambar`) VALUES
(7, 'Ayam Rendang', 'Ayam rendang adalah hidangan tradisional Indonesia yang terbuat dari potongan ayam yang dimasak dalam santan dan rempah-rempah hingga meresap dan berwarna kecokelatan. Dengan cita rasa yang kaya dan tekstur daging yang empuk, ayam rendang sering dianggap sebagai salah satu hidangan terbaik di dunia. Kelezatannya sering kali dipuji karena kombinasi rempah yang kompleks dan proses memasak yang memakan waktu.', 17000, );
INSERT INTO `makanan` (`id_makanan`, `nama_makanan`, `deskripsi`, `harga`, `gambar`) VALUES
(8, 'Ayam Goreng Serundeng', 'Ayam goreng serundeng adalah hidangan khas Indonesia yang terdiri dari potongan ayam goreng yang diselimuti dengan taburan serundeng, campuran kelapa parut yang dipanggang bersama bumbu rempah. Kombinasi antara ayam goreng renyah dan serundeng gurih menciptakan rasa yang lezat dan tekstur yang beragam dalam setiap gigitannya. Hidangan ini sering dihidangkan dengan nasi putih atau nasi uduk sebagai pendampingnya.', 17000, );
INSERT INTO `makanan` (`id_makanan`, `nama_makanan`, `deskripsi`, `harga`, `gambar`) VALUES
(9, 'Sate Ati Ampela', 'Sate satean jeroan ayam adalah potongan jeroan ayam yang dipanggang di tusukan bambu dan disajikan dengan saus kacang atau sambal, menciptakan cita rasa gurih dan pedas yang memikat. Hidangan ini populer di warung-warung sate dan cocok bagi pencinta makanan pedas.', 17000, );

